import React from 'react';
import Console from './Console';

function HomeContainer({ activeLink }) {
  // Define the content to display based on the active link
  let content;
  switch (activeLink) {
    case 'blog':
      content = <p>Blog Content Goes Here</p>;
      break;
    case 'experiences':
      content = <p>Experiences Content Goes Here</p>;
      break;
    default:
      content = <p><Console/></p>;
  }

  return (
    <div className="common-container">
      {content}
    </div>
  );
}

export default HomeContainer;
